export default {
    namespaced:true,
    state:{
        //共有属性
        countyData:[
            {
                id: 1,
                county: '定海区'
            }, 
            {
                id: 2,
                county: '普陀区'
            }, 
            {
                id: 3,
                county: '岱山县'
            }, 
            {
                id: 4,
                county: '嵊泗县'
            }, 
        ],
        townData:[],
        villageData:[],
        //以下为randomOwner属性
        randomOwner:[]
    },
    mutations:{


        
        setRandomOwner(state,data){
            state.randomOwner=data
        },
    }

}
